package main

import (
    "strconv"
    "strings"
)

func Simplify(x, n string) bool {
    // Split the fractions into numerator and denominator
    xParts := strings.Split(x, "/")
    nParts := strings.Split(n, "/")

    // Convert string parts to integers
    xNumerator, _ := strconv.Atoi(xParts[0])
    xDenominator, _ := strconv.Atoi(xParts[1])
    nNumerator, _ := strconv.Atoi(nParts[0])
    nDenominator, _ := strconv.Atoi(nParts[1])

    // Calculate the product of x and n
    // x * n = (xNumerator * nNumerator) / (xDenominator * nDenominator)
    numeratorProduct := xNumerator * nNumerator
    denominatorProduct := xDenominator * nDenominator

    // Check if the result is a whole number
    // This happens if numeratorProduct is divisible by denominatorProduct
    return numeratorProduct%denominatorProduct == 0
}
